  false,\n\t\"url\": null,\n\t\"notes\": \"The Canadian Ice Service (CIS) produces
  digital Arctic regional sea ice charts for marine navigation, climate research,
  and input to the Global Digital Sea Ice Data Bank (GDSIDB). The ice charts are created
  through the manual analysis of in situ, satellite, and aerial reconnaissance data.
  The ice charts have information on ice concentration, stage of development, and
  ice form, following World Meteorological Organization terminology. These sea ice
  charts begin in 2006 and cover the following regions of the Canadian Arctic: Northern
  Canadian waters (Western Arctic, Eastern Arctic, and Hudson Bay) and Southern Canadian
  waters (Great Lakes and East Coast). Each regional shapefile (.shp) (encoded in
  SIGRID-3 format) and associated metadata file (.xml) are combined into a tar archive
  file (.tar) for distribution. All data are available via FTP.\",\n\t\"license_title\":
